mapper.select:

select 

from UC_FEE
where USER_TYPE = #{userType,jdbcType=CHAR}
  and USER_CODE = #{userCode,jdbcType=VARCHAR}
  and CATEGORY_ID = #{categoryId,jdbcType=VARCHAR}
  and CATEGORY = #{category,jdbcType=CHAR}
  and FEE_TYPE = #{feeType,jdbcType=VARCHAR}

mapper.delete:

delete from UC_FEE
where USER_TYPE = #{userType,jdbcType=CHAR}
  and USER_CODE = #{userCode,jdbcType=VARCHAR}
  and CATEGORY_ID = #{categoryId,jdbcType=VARCHAR}
  and CATEGORY = #{category,jdbcType=CHAR}
  and FEE_TYPE = #{feeType,jdbcType=VARCHAR}

mapper.update:

update UC_FEE
set FEE_MODE = #{feeMode,jdbcType=VARCHAR},
  FEE_DESC = #{feeDesc,jdbcType=VARCHAR},
  STATUS = #{status,jdbcType=CHAR},
  PERCENT_FLAG = #{percentFlag,jdbcType=CHAR},
  CREATE_USER = #{createUser,jdbcType=VARCHAR},
  CREATE_TIME = #{createTime,jdbcType=CHAR},
  CREATE_SOURCE = #{createSource,jdbcType=VARCHAR},
  MODIFY_USER = #{modifyUser,jdbcType=VARCHAR},
  MODIFY_TIME = #{modifyTime,jdbcType=CHAR},
  MODIFY_SOURCE = #{modifySource,jdbcType=VARCHAR},
  LOCKED_VERSION = #{lockedVersion,jdbcType=VARCHAR},
  EXTEND1 = #{extend1,jdbcType=VARCHAR},
  EXTEND2 = #{extend2,jdbcType=VARCHAR}
where USER_TYPE = #{userType,jdbcType=CHAR}
  and USER_CODE = #{userCode,jdbcType=VARCHAR}
  and CATEGORY_ID = #{categoryId,jdbcType=VARCHAR}
  and CATEGORY = #{category,jdbcType=CHAR}
  and FEE_TYPE = #{feeType,jdbcType=VARCHAR}
